import React from "react";

import Swan from '../img/Swan.jpg';
import StillLife from '../img/StillLife.jpg';
import Rabbit from '../img/Rabbit.jpg';
import TransparencyS from '../img/TransparencyS.jpg';
import Train from '../img/Train.jpg';
import Crane from '../img/Crane.jpg';
import Compass from '../img/Compass.jpg';
import Organic from '../img/Organic.jpg';
import Experiment from '../img/Experiment.jpg';
import Ostrich from '../img/Ostrich.jpg';
import Lantern from '../img/Lantern.jpg';
import KoiMoon from '../img/KoiMoon.jpg';
import Girl from '../img/Girl.jpg';
import Rooster from '../img/Swan.jpg';
import Siren from '../img/Swan.jpg';
import Horse from '../img/Horse.jpg';
import Guy from '../img/Guy.jpg';
import Fishbowl from '../img/Fishbowl.jpg';
import Moon from '../img/Moon.jpg';
import MarbleOstrich from '../img/MarbleOstrich.jpg';


import "./ProjectsInfo.css";

const Artwork = () => {
    return (
            <div className="artwork">
                <img src={Swan} alt="Swan"/>
                <img src={StillLife} alt="Chinese porcelain still life"/>
                <img src={Rabbit} alt="Paper cutout of rabbit"/>
                <img src={TransparencyS} alt="Craft of train tracks"/>
                <img src={Train} alt="Paper cutout of train tracks"/>
                <img src={Crane} alt="Crane collage"/>
                <img src={Compass} alt="Paper cutouts laid in four cardinal directions"/>
                <img src={Organic} alt="Egg dropping into cup"/>
                <img src={Experiment} alt="Paper cutout of rat"/>
                <img src={Ostrich} alt="Paper cutout of ostrich against trees"/>
                <img src={Lantern} alt="Colored pencil drawing of lanterns"/>
                <img src={KoiMoon} alt="Paper cutout of koi against moon"/>
                <img src={Girl} alt="Sketch of girl"/>
                <img src={Rooster} alt="Drawing of rooster on book"/>
                <img src={Siren} alt="Paper cutout of siren"/>
                <img src={Horse} alt="Drawing of horse on book"/>
                <img src={Guy} alt="Sketch of guy"/>
                <img src={Fishbowl} alt="Paper cutout of fish"/>
                <img src={Moon} alt="Horse and butterfly collage"/>
                <img src={MarbleOstrich} alt="Paper cutout of ostrich against marble"/>
            </div>
    );
  };

  export default Artwork;
